import React from "react";

import { Route , Routes } from "react-router";
import Login from "./Login/Login";
import { BrowserRouter } from "react-router-dom";
const url = "http://localhost:8080"

export const App = () =>{

    return(
        
        <React.StrictMode>
            <BrowserRouter>
                <Routes>
                    <Route path='/login' element={<Login />}></Route>
    
                </Routes>
            </BrowserRouter>

      </React.StrictMode>
    )
}
